import './contact.css';

export default function Contact() {
  return (
    <section>

    <div className="container">

      <heading className="heading">
      <h1>Contact</h1>
      </heading>
        <subheading className="subHeading">
          <h2>Get In Touch</h2>
        </subheading>

    </div>

    </section>
  )
}
